          "https://pplz-fun-3dviewer-d.pplz-iase-1d.appserviceenvironment.net/api";
        this._gisAssetsUrl =
          "https://pplz-fun-gis-d.pplz-iase-1d.appserviceenvironment.net/api/call/GET?code=B94EMuX2I9aOaKutwoWev3FW5e2aZhFpX874/D5XAKsMbQy6psO7dA==";
